import Nav from "./Nav";
import Hero from "./Hero";
import Card from "./Card";
import YFAC from "./YFAC";

export default function App() {
  return (
    <div>
      <div class="h-screen">
        <Nav />
        <Hero />
      </div>

      <div class="bg-white">
        <Card />
        <YFAC />
      </div>
    </div>
  );
}
